public class InnerStudioComponentStudioComponentConfigurationFactory(Action<Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration>
{

    internal InnerStudioComponentLicenseServiceConfigurationFactory LicenseServiceConfigurationFactory { get; set; }

    internal InnerStudioComponentComputeFarmConfigurationFactory ComputeFarmConfigurationFactory { get; set; }

    internal InnerStudioComponentActiveDirectoryConfigurationFactory ActiveDirectoryConfigurationFactory { get; set; }

    internal InnerStudioComponentSharedFileSystemConfigurationFactory SharedFileSystemConfigurationFactory { get; set; }

    protected override Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration Create()
    {
        var studioComponentConfigurationResult = CreateStudioComponentConfiguration();
        factoryAction?.Invoke(studioComponentConfigurationResult);

        return studioComponentConfigurationResult;
    }

    private Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration CreateStudioComponentConfiguration()
    {
        var studioComponentConfigurationResult = new Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration();

        return studioComponentConfigurationResult;
    }
    public override void CreateChildren(Humidifier.NimbleStudio.StudioComponentTypes.StudioComponentConfiguration result)
    {
        base.CreateChildren(result);

        result.LicenseServiceConfiguration ??= LicenseServiceConfigurationFactory?.Build();
        result.ComputeFarmConfiguration ??= ComputeFarmConfigurationFactory?.Build();
        result.ActiveDirectoryConfiguration ??= ActiveDirectoryConfigurationFactory?.Build();
        result.SharedFileSystemConfiguration ??= SharedFileSystemConfigurationFactory?.Build();
    }

} // End Of Class

